        return (
            <div
                style={{
                    backgroundColor: 'gray',
                    width: '20px',
                    height: '20px',
                    display: 'inline-block',
                }}>
                {/*{props.position.row}, {props.position.col}*/}
            </div>
        );
    }
};

export default Cell;
